sys_variable_value.value:
(function execute(inputs, outputs) {
  var jsonObject={};
  jsonObject = inputs.parameter.data.healthDetails;
  // gs.info('checking   '+jsonObject)

  var parsedData = JSON.parse(jsonObject);
  var healthDetails = parsedData.healthDetails;

  outputs.response = healthDetails;
  // gs.info(jsonObject);
})(inputs, outputs);

